import Link from 'next/link'

const About = () => (
    <div>
        
        <li><Link href = "/"><a>Home</a></Link></li>
            <li><Link href = "/about"><a>About</a></Link></li>
        <h1>
            About the Prices.
        </h1>
        <p> Application that I made for practice Next.js</p>
    </div>
);

export default About;
